function TextBox(props) {
    return (
    <div>
      {props.label + ": "}
      <input 
        type={"text"} 
        label={props.label} 
        required 
        value={props.value}
        onChange={(e) => props.change(e.target.value)} 
        />
    </div>
  )
}

